window.bookSummaryJSON = "<p><b>Best-selling author and narrator team from </b><b><i>Solitude</i></b><b>: Dimension Space book one.</b></p> <p>Humans rule the galaxy...today!</p> <p>The galaxy’s predominant species discovers a lost colony of their ancestors - humans - populating today’s Earth. Then, our genetic link draws the attention and enmity of their galactic rivals.</p> <p>When a plan to elevate present-day Earth leads to an alien invasion, a team of military officers may be all that stands between humanity and certain annihilation. If you like action-packed novels, then you'll love the electrifying action in this apocalyptic thriller.</p> <p>Grab <i>Ambush </i>today!</p> <p><i>Independence Day</i> meets <i>The X-Files</i> when Air Force fighter pilots Jake Giard and Sandra Fitzpatrick join a decades-old secret project to integrate today's Earth into a galactic government. But when a galactic war spills onto our shores, plunging the planet into an otherworldly post-apocalyptic hell, can Jake and Sandy save humanity from extinction?</p>"; 
